import styled from 'styled-components';

export const Container = styled.div`
    min-height: calc(100vh - 80px);
    position: relative;
    bottom: 0;
    left: 0;
    right: 0;
    top: 0;
    z-index: 0;
    overflow: hidden;
    background: linear-gradient(
        108deg,
        rgba(11, 83, 69 ) 0%,
        rgba(23, 165, 137) 100%
    );
`;

export const Wrap = styled.div`
    display: block;
    margin: 50px auto;
    padding: 40px 100px;
    width: 60%;
    background: #1b2631;
    color: #fff;
    border-radius: 8px;
`;

export const NewH1 = styled.h1`

`

